import React, { Component } from 'react'
import { NavLink, Redirect } from 'react-router-dom'; 
import AuthContext from '../components/context/AuthContext'
import { orderApi } from '../components/misc/OrderApi'
import { parseJwt, handleLogError } from '../components/misc/Helpers'
import { Button, Label, Input } from '@windmill/react-ui';

class SignUp extends Component {
  static contextType = AuthContext;

  state = {
    username: '',
    password: '',
    name: '',
    email: '',
    isLoggedIn: false,
    isError: false,
    errorMessage: ''
  }

  componentDidMount() {
    const Auth = this.context;
    const isLoggedIn = Auth.userIsAuthenticated();
    this.setState({ isLoggedIn });
  }

  handleInputChange = (e) => {
    this.setState({ [e.target.name]: e.target.value })
  }

  handleSubmit = (e) => {
    e.preventDefault()

    const { username, password, name, email } = this.state
    if (!(username && password && name && email)) {
      this.setState({
        isError: true,
        errorMessage: 'Please, inform all fields!'
      })
      return
    }

    const user = { username, password, name, email }
    orderApi.signup(user)
      .then(response => {
        const { accessToken } = response.data
        const data = parseJwt(accessToken)
        const user = { data, accessToken }

        const Auth = this.context
        Auth.userLogin(user)

        this.setState({
          username: '',
          password: '',
          isLoggedIn: true,
          isError: false,
          errorMessage: ''
        })
      })
      .catch(error => {
        handleLogError(error)
        if (error.response && error.response.data) {
          const errorData = error.response.data
          let errorMessage = 'Invalid fields'
          if (errorData.status === 409) {
            errorMessage = errorData.message
          } else if (errorData.status === 400) {
            errorMessage = errorData.errors[0].defaultMessage
          }
          this.setState({
            isError: true,
            errorMessage
          })
        }
      })
  }

  render() {
    const { isLoggedIn, isError, errorMessage } = this.state

    if (isLoggedIn) {
      return <Redirect to='/app' />
    } else {
      return (
        <div className="flex items-center min-h-screen p-6 bg-gray-50 dark:bg-gray-900">
          <div className="flex-1 h-full max-w-4xl mx-auto overflow-hidden bg-white rounded-lg shadow-xl dark:bg-gray-800">

              <main className="flex items-center justify-center p-6 sm:p-12 md:w-1/2">
                <div className="w-full">
                  <h1 className="mb-4 text-xl font-semibold text-gray-700 dark:text-gray-200">
                    Create account
                  </h1>
                  <div className="grid grid-cols-2 gap-4">
                    <Label>
                      <span>Username</span>
                      <Input
                        className="mt-1"
                        name="username"
                        placeholder="Username"
                        onChange={this.handleInputChange}
                      />
                    </Label>
                    <Label>
                      <span>Name</span>
                      <Input
                        className="mt-1"
                        name="name"
                        placeholder="Name"
                        onChange={this.handleInputChange}
                      />
                    </Label>
                    <Label>
                      <span>Email</span>
                      <Input
                        className="mt-1"
                        type="email"
                        placeholder="john@doe.com"
                        name="email"
                        onChange={this.handleInputChange}
                      />
                    </Label>
                    <Label>
                      <span>Password</span>
                      <Input
                        className="mt-1"
                        placeholder="***************"
                        type="password"
                        name="password"
                        onChange={this.handleInputChange}
                      />
                    </Label>
                    <Label>
                      <span>Company Address</span>
                      <Input
                        className="mt-1"
                        name="companyAddress"
                        placeholder="Company Address"
                        onChange={this.handleInputChange}
                      />
                    </Label>
                    <Label>
                      <span>Communication Name</span>
                      <Input
                        className="mt-1"
                        name="communicationName"
                        placeholder="Communication Name"
                        onChange={this.handleInputChange}
                      />
                    </Label>
                    <Label>
                      <span>Phone</span>
                      <Input
                        className="mt-1"
                        name="phone"
                        placeholder="Phone"
                        onChange={this.handleInputChange}
                      />
                    </Label>
                    <Label>
                      <span>Company Name</span>
                      <Input
                        className="mt-1"
                        name="companyName"
                        placeholder="Company Name"
                        onChange={this.handleInputChange}
                      />
                    </Label>
                    <Label>
                      <span>Bulstat</span>
                      <Input
                        className="mt-1"
                        name="bulstat"
                        placeholder="Bulstat"
                        onChange={this.handleInputChange}
                      />
                    </Label>
                    <Label>
                      <span>City</span>
                      <Input
                        className="mt-1"
                        name="city"
                        placeholder="City"
                        onChange={this.handleInputChange}
                      />
                    </Label>
                    {/* Add other fields here */}
                  </div>
                  <Button
                    className="mt-4"
                    block
                    to="/login"
                    onClick={this.handleSubmit}
                  >
                    Signup
                  </Button>
                  {/* ... */}
                </div>
              </main>
            </div>
          </div>
        )
    }
  }
}

export default SignUp;
